    PostComponent.prototype.parseposts = function (parsedPosts) {
        parsedPosts.forEach(function (post, i) {
            var IMG = [];
            var AUDIO = [];
            var VIDEO = [];
            post.activity_attachment.forEach(function (att) {
                if (att.type === 'IMG') {
                    IMG = IMG.concat(att);
                }
                if (att.type === 'AUDIO') {
                    AUDIO = AUDIO.concat(att);
                }
                if (att.type === 'VIDEO') {
                    VIDEO = VIDEO.concat(att);
                }
            });
            parsedPosts[i]['activity_attachment'] = {
                'IMG': IMG,
                'AUDIO': AUDIO,
                'VIDEO': VIDEO,
            };
            if (post.original_activity) {
                var _IMG_1 = [];
                var _AUDIO_1 = [];
                var _VIDEO_1 = [];
                post.original_activity.activity_attachment.forEach(function (att) {
                    if (att.type === 'IMG') {
                        _IMG_1 = IMG.concat(att);
                    }
                    if (att.type === 'AUDIO') {
                        _AUDIO_1 = AUDIO.concat(att);
                    }
                    if (att.type === 'VIDEO') {
                        _VIDEO_1 = VIDEO.concat(att);
                    }
                });
                parsedPosts[i].original_activity['activity_attachment'] = {
                    'IMG': _IMG_1,
                    'AUDIO': _AUDIO_1,
                    'VIDEO': _VIDEO_1,
                };
            }
        });
        return parsedPosts;
    };
